import React, { Component } from 'react';
import { BrowserRouter as Router, Redirect } from 'react-router-dom';
import { Route } from 'react-router';
import './App.css';

import apps from './apps';
import Main from './boilerplate';
import CompanyRouter from './apps/company';
import EmployeeRouter from './apps/employee';


function App() {
  const routeList = Object.keys(apps.services).map(route => {
    return <Route exact path={ `/${route}` } component={ apps.services[route] } key={ route }/>;
  })

  return (
    <div className="App">
      <Router>
        <Route path="/" component={ Main }/>
        <Route exact path="/">
          <Redirect push to="/home" />
        </Route>
        { CompanyRouter() }
        { EmployeeRouter }
      </Router>
    </div>
  );
}

export default App;
